You probably already know what we're going to talk about in the next paragraphs from Javascript which I assume most know. If your exposure to Javascript has given you any sorts of PTSD earlier in life, close your eyes now and scroll down for 2-3 seconds. You'll find a link there that takes you to safety. The whole idea behind a callback based approach is to save a pointer to a set of instructions we want to run later. We can save that pointer on the stack before we yield control to the runtime, or in some sort of collection as we do below. The basic idea of not involving threads as a primary way to achieve concurrency is the common denominator for the rest of the approaches. Including the one Rust uses today which we'll soon get to. Advantages: Easy to implement in most languages No context switching Low memory overhead (in most cases) Drawbacks: Each task must save the state it needs for later, the memory usage will grow linearly with the number of callbacks in a chain of computations. Can be hard to reason about, many people already know this as as "callback hell". It's a very different way of writing a program, and it can be difficult to get an understanding of the program flow. Sharing state between tasks is a hard problem in Rust using this approach due to it's ownership model. An extremely simplified example of a how a callback based approach could look like is: fn program_main() { println!("So we start the program here!"); set_timeout(200, || { println!("We create tasks which gets run when they're finished!"); }); set_timeout(100, || { println!("We can even chain callbacks..."); set_timeout(50, || { println!("...like this!"); }) }); println!("While our tasks are executing we can do other stuff here.");
} fn main() { RT.with(|rt| rt.run(program_main));
} use std::sync::mpsc::{channel, Receiver, Sender};
use std::{cell::RefCell, collections::HashMap, thread}; thread_local! { static RT: Runtime = Runtime::new();
} struct Runtime { callbacks: RefCell<HashMap<usize, Box<dyn FnOnce() -> ()>>>, next_id: RefCell<usize>, evt_sender: Sender<usize>, evt_reciever: Receiver<usize>,
} fn set_timeout(ms: u64, cb: impl FnOnce() + 'static) { RT.with(|rt| { let id = *rt.next_id.borrow(); *rt.next_id.borrow_mut() += 1; rt.callbacks.borrow_mut().insert(id, Box::new(cb)); let evt_sender = rt.evt_sender.clone(); thread::spawn(move || { thread::sleep(std::time::Duration::from_millis(ms)); evt_sender.send(id).unwrap(); }); });
} impl Runtime { fn new() -> Self { let (evt_sender, evt_reciever) = channel(); Runtime { callbacks: RefCell::new(HashMap::new()), next_id: RefCell::new(1), evt_sender, evt_reciever, } } fn run(&self, program: fn()) { program(); for evt_id in &self.evt_reciever { let cb = self.callbacks.borrow_mut().remove(&evt_id).unwrap(); cb(); if self.callbacks.borrow().is_empty() { break; } } }
} We're keeping this super simple, and you might wonder what's the difference between this approach and the one using OS threads an passing in the callbacks to the OS threads directly. The difference is that the callbacks are run on the same thread using this example. The OS threads we create are basically just used as timers.

