You might start to wonder by now, when are we going to talk about Futures? Well, we're getting there. You see promises, futures and other names for deferred computations are often used interchangeably. There are formal differences between them but we'll not cover that here but it's worth explaining promises a bit since they're widely known due to beeing used in Javascript and will serve as segway to Rusts Futures. First of all, many languages has a concept of promises but I'll use the ones from Javascript in the examples below. Promises is one way to deal with the complexity which comes with a callback based approach. Instead of: setTimer(200, () => { setTimer(100, () => { setTimer(50, () => { console.log("I'm the last one"); }); });
}); We can to this: function timer(ms) { return new Promise((resolve) => setTimeout(resolve, ms))
} timer(200)
.then(() => return timer(100))
.then(() => return timer(50))
.then(() => console.log("I'm the last one)); The change is even more substantial under the hood. You see, promises return a state machine which can be in one of three states: pending, fulfilled or rejected. So when we call timer(200) in the sample above, we get back a promise in the state pending. Since promises are re-written as state machines they also enable an even better syntax where we now can write our last example like this: async function run() { await timer(200); await timer(100); await timer(50); console.log("I'm the last one");
} You can consider the run function a pausable task consisting of several sub-tasks. On each "await" point it yields control to the scheduler (in this case it's the well known Javascript event loop). Once one of the sub-tasks changes state to either fulfilled or rejected the task is sheduled to continue to the next step. Syntactically, Rusts Futures 1.0 was a lot like the promises example above and Rusts Futures 3.0 is a lot like async/await in our last example. Now this is also where the similarities with Rusts Futures stop. The reason we go through all this is to get an introduction and get into the right mindset for exploring Rusts Futures. To avoid confusion later on: There is one difference you should know. Javascript promises are eagerly evaluated. That means that once it's created, it starts running a task. Rusts Futures on the other hand is lazily evaluated. They need to be polled once before they do any work. You'll see in a moment. PANIC BUTTON (next chapter)
